    "Multifunctional Metal Matrix Composite Filament Wound Tank Liners Project",nt"tracking_summary":
    {ntt"total": 21,ntt"recent": 2nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T00:53:57.434261",nt"name": "multifunctional-metal-matrix-composite-filament-wound-tank-liners-project",nt"isopen":
    true,nt"url": null,nt"notes": "Metal Matrix Composite (MMC) materials offer
    tremendous potential for lightweight propellant and pressurant tankage for space
    applications.  Thin MMC liners for COPVs would have enough strength to withstand
    tensile loading at maximum expected operating pressure (MEOP) and compressive loading
    at zero pressure without buckling.  Thus, performance benefits would be expected
    when compared to aluminum, titanium, and stainless steel liners.  Touchstone proposes
    to team with Carleton Technologies Pressure Vessel Division (part of the Cobham
    Life Support Division, Westminster, MD) to extend current MMC technology into the
    area of lightweight, multifunctional pressure vessels that can minimize propulsion
    system mass growth and achieve the efficiencies that will make future propulsion
    systems viable.  The development of improved cryotanks can easily be extended to
    programs within the Departments of Defense and to private industry. The successful
    completion of the proposed work will expedite the implementation of this enabling
    technology into aerospace, military, and commercial applications.rnrn",nt"license_title":
